import React from 'react';


class App extends React.Component {
  constructor() {
    super();
    this.getLogged = this.props.getLogged.bind(this);
    this.state = {
      logged: false,
      id_user: null
    };
  }









  render() {

    return (

      <div className="global_app">
          {this.state.logged ? 
            <div className="App">
              <Navbar/>
